import Avatar from '../Avatar/style'
export default () => {
    return (
        <Avatar>
            <div>
                <img src="https://scontent.fpoa31-1.fna.fbcdn.net/v/t1.0-9/123576236_3477206379011214_6172465767219113644_o.jpg?_nc_cat=108&ccb=2&_nc_sid=09cbfe&_nc_eui2=AeHnpFTpl0-8xpl6XkXXwWNWhJYi2glVCraEliLaCVUKtrhQecpD3weIA-XWQP3C7NeuIPaJCp_95FVLExMBjo01&_nc_ohc=_JcFLvEi7dgAX9j6BH1&_nc_ht=scontent.fpoa31-1.fna&oh=8dc1d7ea60989ebe245022ddbb645aad&oe=60042F71"></img>

                {/* <img src="https://meuamigopet.com.br/wp-content/uploads/2019/10/pitbull-terrier-am%C3%A9ricain-80916843.jpg"></img> */}
            </div>
        </Avatar>)

}
